INSERT INTO `messages` (`id`, `user_id`, `body`, `media_id`, `created_at`, `updated_at`) VALUES ('1', 260, 'Velit fugiat soluta eligendi illum totam distinctio. Rerum nam non quos similique velit maxime. Ullam voluptatem praesentium nisi repudiandae hic eos voluptatem. Esse a necessitatibus iusto veniam iure molestiae magnam voluptatem.', '125', '2020-02-08 20:50:46', '2020-02-12 19:05:35');
INSERT INTO `messages` (`id`, `user_id`, `body`, `media_id`, `created_at`, `updated_at`) VALUES ('2', 110, 'Sit alias et dignissimos occaecati maiores autem maiores. Impedit qui temporibus officia non. Quasi autem ut ex corrupti necessitatibus voluptas aut.', '432', '2020-05-26 13:30:33', '2020-09-01 16:16:22');
INSERT INTO `messages` (`id`, `user_id`, `body`, `media_id`, `created_at`, `updated_at`) VALUES ('3', 232, 'Non quisquam cumque libero quos. Voluptates dicta dicta incidunt omnis delectus fugiat vero. Nobis nobis similique officiis consequatur quaerat est. Sint consequuntur facere omnis velit nobis rem.', '195', '2020-08-25 11:05:55', '2020-01-18 17:39:35');
INSERT INTO `messages` (`id`, `user_id`, `body`, `media_id`, `created_at`, `updated_at`) VALUES ('4', 181, 'Voluptas ducimus temporibus minima tenetur. Aspernatur vel porro ipsum quod.', '151', '2020-09-08 06:15:23', '2020-08-25 06:49:15');
